atedAt=new Date(155670568e4),r.layout=a,r.title="利用 CSS 媒体查询让网页配色跟随 macOS 深色模式",r.keywords="CSS,media queries,macos dark mode",r.description="苹果公司的操作系统 macOS 从 10.14 Mojave 版本开始，户提供了深色模式（Dark Mode）的外观。本文介绍利用 CSS 媒体查询（media queries）中的 prefers-color-scheme 媒体特征（media feature）做到让网页跟随 macOS Mojave 的黑暗模式进行配色自动切换。",r.date=c,r.updated=c,r.assets={cover:t(50),feature:t(51)},r.categories=[o],r.tags=["前端"],r.feature=!0,r.markdownHeadings=[],r.excerpt='<p>苹果公司的操作系统 macOS 从 10.14 Mojave 版本开始，为用户提供了<a href="https://www.apple.com/cn/macos/mojave/">深色模式</a>的可选外观。用户可以在系统中的通用设置里选择启用深色模式，整个系统的界面会全局变为暗色调。对于夜间使用场景而言，深色模式的界面可能会显得更加友好，也更能让用户集中注意力。</p>\n',r.permalink="/blog/2019/05/macos-mojave-dark-mode-in-css",r.attributes=r,l.type=a,l.internal=A,l.contentType=n,l.slug="recent-changes-of-my-site",l.content=A,l.createdAt=new Date(155584126e4),l.updatedAt=new Date(155584568e4),l.layout=a,l.title="总结下博客最近的调整",l.keywords="Blog,Hexo,Static Site Generator,Saber,Netlify",l.description="我建博客始于 2013 年，时间也不长。那会儿也不过是一个从 WordPress 加免费空间入坑的新手，免费空间关了就买了个域名和虚拟空间继续折腾。啊对，也改成了 Typecho 一段时间，仿过几个主题。之后便是在流行之下换成了静态博客 Hexo。",l.date="2019-04-21 18:07:40",l.updated="2019-04-21 19:21:20",l.pageCoverMode=g,l.assets={cover:t(67)},l.categories=[o],l.markdownHeadings=[{text:"Old Days",slug:"old-days",level:2},{text:"Changes",slug:"changes",level:2}],l.excerpt='<p>我建博客始于 2013 年，时间也不长。那会儿也不过是一个从 WordPress 加免费空间入坑的新手，免费空间关了就买了个域名和虚拟空间继续折腾。啊对，也改成了 Typecho 一段时间，仿过几个主题。之后便是在流行之下，一个 <a href="https://github.com/h404bi/www.h404bi.com/commit/88362f79adfea93151ecc9f19f8647cd28562c2c">commit</a> 换成了静态博客 Hexo。于是开始在这个“自留地/实验室”里摆弄各种新玩意，做做小试验。没写过几篇文章，却也一直延续至今。</p>\n',l.permalink="/blog/2019/04/recent-changes-of-my-site",l.attributes=l,d.type=a,d.internal=A,d.contentType=n,d.slug="understanding-windows-console-host-settings",d.content=A,d.createdAt=new Date(1550498523e3),d.updatedAt=new Date(155188532e4),d.layout=a,d.title="彻底搞懂 Windows 控制台的设置",d.keywords="Windows控制台,ConHost.exe,Windows控制台设置,Windows10控制台",d.description="Windows Console Host（即 conhost.exe）中的设置（比如如何修改命令行字体为 Sarasa Gothic 等）可能有点难以理解，主要是因为在过去几十年中这个设置系统不断发展。根据 ConHost 如何被调用，这些设置项会存储在不同的位置。",d.date="2019-02-18 22:02:03",d.updated="2019-03-06 23:15:20",d.pageCoverMode=g,d.assets={cover:t(66)},d.categories=[o],d.markdownHeadings=[{text:w,slug:w,level:2},{text:u,slug:u,level:2},{text:m,slug:m,level:3},{text:s,slug:s,level:2}],d.excerpt='<p>Windows Console Host（即 <code v-pre="">conhost.exe</code>，下称“ConHost”<sup class="footnote-ref"><a href="#fn1" id="fnref1">[1]</a></sup>）中的设置可能有点难以理解，主要是因为在过去几十年中这个设置系统不断发展。根据 ConHost 如何被调用，这些设置项会存储在不同的位置。</p>\n',d.permalink="/blog/2019/02/understanding-windows-console-host-settings",d.attributes=d,f.type=a,f.internal=A,f.contentType=n,f.slug="talk-about-scoop-the-package-manager-for-windows-again",f.content=A,f.createdAt=new Date(1526132679e3),f.updatedAt=new Date(157098077e4),f.layout=a,f.title="再谈谈 Scoop 这个 Windows 下的软件包管理器",f.keywords="Windows 包管理器,windows package manager,Scoop Chocolatey, Scoop 安装,Windows 包管理工具,Chocolatey vs Scoop",f.description="与 Chocolatey Windows 包管理工具（Package Manager）相比，Scoop 是一款更为轻量的 Windows 包管理器。本文将对比 Chocolatey Scoop 这两款工具的区别，介绍一下 Scoop 安装使用体验，如果你没有重度的包管理需求，不妨可以尝试一下 Scoop PowerShell Concfg 这套组合。",f.date="2018-05-12 21:44:39",f.updated="2019-10-13 23:32:50",f.pageCoverMode=g,f.assets={cover:t(52),feature:t(65)},f.categories=[o],f.feature=!0,f.markdownHeadings=[{text:E,slug:E,level:2},{text:"Why Scoop",slug:"why-scoop",level:2},{text:"How Scoop",slug:"how-scoop",level:2},{text:"但 Scoop 还有问题",slug:"但-scoop-还有问题",level:2},{text:B,slug:B,level:3},{text:S,slug:S,level:3},{text:"结语",slug:"结语",level:2}],f.excerpt='<p>在 2015 年的《<a href="/blog/2015/08/use-scoop-to-enhance-windows-powershell">用 Scoop 改善 Windows Powershell</a>》博文中，我曾经介绍过这个令我眼前一亮的 Windows 软件包管理器。那是我刚开始使用上 Scoop 的时候，回看过去对它的介绍，也确像是一见钟情后的入坑纪实。简单，直接。</p>\n',f.permalink="/blog/2018/05/talk-about-scoop-the-package-manager-for-windows-again",f.attributes=f,b.type=a,b.internal=A,b.contentType=n,b.slug="office-2016-custom-installation-guide",b.content=A,b.createdAt=new Date(1521833607e3),b.updatedAt=new Date(1521954e6),b.layout=a,b.title="Microsoft Office 2016 自定义安装",b.keywords="Office 2016 自定义安装,Outlook 关闭时不退出,Outlook 最小化",b.description="本文将简要说明一下 Office 2016 自定义安装的方法（2019 同样适用），以及提供 Outlook 关闭时不退出，Outlook 关闭时最小化到托盘的小技巧，适合想 Office 只安装 Word、Excel 的同学。",b.date="2018-03-24 03:33:27",b.updated="2018-03-25 13:00:00",b.pageCoverMode=g,b.assets={cover:t(64)},b.categories=[o],b.markdownHeadings=[{text:"卸载已安装的 Office",slug:"卸载已安装的-office",level:2},{text:"重新自定义安装 Office",slug:"重新自定义安装-office",level:2},{text:"结尾小 Tips",slug:"结尾小-tips",level:2}],b.excerpt="<p>作为宇宙第一 IDE Visual Studio 的兄弟，宇宙第一办公套件 Office 在 Windows\n系统下更加常见。新安装的系统，即使刚开始不愿安装，等到要查看编辑 docx pptx\n文档时，还是会乖乖就擒。只是没想到，Office 2016 这个 2.41GB 的安装镜像，居然是一个 Click-to-Run。</p>\n",b.permalink="/blog/2018/03/office-2016-custom-installation-guide",b.attributes=b,H.type=a,H.internal=A,H.contentType=n,H.slug="henet-6in4-ipv6-tunnel-on-openwrt",H.content=A,H.createdAt=new Date(1486903493e3),H.updatedAt=new Date(1486903493e3),H.layout=a,H.title="Openwrt 配置 he.net IPv6 隧道",H.date=x,H.updated=x,H.keywords="OpenWrt IPv6,IPv6 隧道,Openwrt 6in4,he.net",H.description="本文将介绍关于 OpenWrt IPv6 He.net 相关的内容，记录如何利用 he.net 在 Openwrt 配置 IPv6 隧道，以及配置完成后进行 ipv6 测试验证，确定 Openwrt 6in4 的可用性。 ",H.assets={cover:t(60)},H.categories=[o],H.markdownHeadings=[{text:"创建 HE 6in4 隧道",slug:"创建-he-6in4-隧道",level:2},{text:"Openwrt 配置 HE 6in4",slug:"openwrt-配置-he-6in4",level:2}],H.excerpt="<p>之前还在大学时，除开锐捷，由于内网的原因，要玩 IPv6 的话就只能用六飞之类的工具。工作后，发现在住所报装的网络，居然给（是的，长这么大第一次在家用宽带得到）了公网 IP。刚开始时想过利用这个公网 IP 来搞个 Minecraft“家庭服”，对小伙伴们开放。但折腾下来发现上传太可怜了，还是不祸害小伙伴了。</p>\n",H.permalink="/blog/2017/02/henet-6in4-ipv6-tunnel-on-openwrt",H.attributes=H,v.type=a,v.internal=A,v.contentType=n,v.slug="new-mac-env-bootstrap",v.content=A,v.createdAt=new Date(1442741299e3),v.updatedAt=new Date(1442741299e3),v.layout=a,v.title="Newbie Mac Bootstrap",v.date=Q,v.updated=Q,v.assets={cover:t(57)},v.categories=[o],v.markdownHeading